\u0438<\/a>. \u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%B8%D0%B5_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D1%8B%D0%B5_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B\" title=\"\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0435 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u044b\u0435 \u0432\u043e\u0439\u043d\u044b\">\u0420\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u044b\u0445 \u0432\u043e\u0439\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1794_%D0%B3%D0%BE%D0%B4\" title=\"1794 \u0433\u043e\u0434\">1794<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u0433\u0438\u043b\u044c\u043e\u0442\u0438\u043d\u0438\u0440\u043e\u0432\u0430\u043d \u0431\u044b\u0432\u0448\u0438\u0439 \u043c\u044d\u0440, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%81%D1%82%D1%80%D0%BE%D0%BD%D0%BE%D0%BC\" title=\"\u0410\u0441\u0442\u0440\u043e\u043d\u043e\u043c\">\u0430\u0441\u0442\u0440\u043e\u043d\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%94%D0%B5_%D0%A1%D0%B0%D1%80%D0%BE%D0%BD,_%D0%96%D0%B0%D0%BD&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0414\u0435 \u0421\u0430\u0440\u043e\u043d, \u0416\u0430\u043d (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0416\u0430\u043d \u0434\u0435 \u0421\u0430\u0440\u043e\u043d<\/a> (Jean-Baptiste-Gaspard (Bochart) de Saron).<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1809_%D0%B3%D0%BE%D0%B4\" title=\"1809 \u0433\u043e\u0434\">1809<\/a>&#160;\u2014 \u041f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0430\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B1%D0%B5%D0%BD%D1%81%D0%B1%D0%B5%D1%80%D0%B3%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0410\u0431\u0435\u043d\u0441\u0431\u0435\u0440\u0433\u0441\u043a\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435\">\u0431\u043e\u044e \u0443 \u0410\u0431\u0435\u043d\u0441\u0431\u0435\u0440\u0433\u0430<\/a> \u0441 \u0430\u0440\u043c\u0438\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0430<\/a> \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0410\u0432\u0441\u0442\u0440\u043e-\u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1832_%D0%B3%D0%BE%D0%B4\" title=\"1832 \u0433\u043e\u0434\">1832<\/a>&#160;\u2014 \u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0439 \u0430\u043a\u0443\u0448\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D1%8C%D1%84,_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B9_%D0%9C%D0%B0%D1%80%D1%82%D1%8B%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0412\u043e\u043b\u044c\u0444, \u0410\u043d\u0434\u0440\u0435\u0439 \u041c\u0430\u0440\u0442\u044b\u043d\u043e\u0432\u0438\u0447\">\u0410\u043d\u0434\u0440\u0435\u0439 \u0412\u043e\u043b\u044c\u0444<\/a> \u0441\u0434\u0435\u043b\u0430\u043b \u043f\u0435\u0440\u0432\u043e\u0435 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u0443\u0441\u043f\u0435\u0448\u043d\u043e\u0435 \u043f\u0435\u0440\u0435\u043b\u0438\u0432\u0430\u043d\u0438\u0435 \u043a\u0440\u043e\u0432\u0438. \u0414\u043e\u043d\u043e\u0440\u043e\u043c \u0440\u043e\u0436\u0435\u043d\u0438\u0446\u044b \u0441 \u043a\u0440\u043e\u0432\u043e\u0442\u0435\u0447\u0435\u043d\u0438\u0435\u043c \u0441\u0442\u0430\u043b \u0435\u0451 \