u0441\u043a\u0430\u044f \u0410\u041e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1923_%D0%B3%D0%BE%D0%B4\" title=\"1923 \u0433\u043e\u0434\">1923<\/a>&#160;\u2014 \u041d\u0430 \u0441\u044a\u0435\u0437\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%A1%D0%BE%D1%8E%D0%B7%D0%B0\" title=\"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430\">\u0420\u041a\u041f(\u0431)<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%BE%D1%86%D0%BA%D0%B8%D0%B9,_%D0%9B%D0%B5%D0%B2_%D0%94%D0%B0%D0%B2%D0%B8%D0%B4%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0422\u0440\u043e\u0446\u043a\u0438\u0439, \u041b\u0435\u0432 \u0414\u0430\u0432\u0438\u0434\u043e\u0432\u0438\u0447\">\u041b\u0435\u0432 \u0422\u0440\u043e\u0446\u043a\u0438\u0439<\/a> \u0437\u0430\u043f\u0443\u0441\u0442\u0438\u043b \u0432 \u043e\u0431\u043e\u0440\u043e\u0442 \u0444\u0440\u0430\u0437\u0443 \u00ab\u0441\u043c\u044b\u0447\u043a\u0430 \u0433\u043e\u0440\u043e\u0434\u0430 \u0441 \u0434\u0435\u0440\u0435\u0432\u043d\u0435\u0439\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1924_%D0%B3%D0%BE%D0%B4\" title=\"1924 \u0433\u043e\u0434\">1924<\/a>&#160;\u2014 \u041f\u0440\u0438\u043d\u044f\u0442\u0438\u0435 \u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0435\u0446\u043a\u043e\u0439 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0435<\/a> \u0437\u0430\u0432\u043e\u0434 \u00ab\u041f\u0440\u043e\u043c\u0435\u0442\u00bb \u043e\u0441\u0432\u043e\u0438\u043b \u0432\u044b\u043f\u0443\u0441\u043a \u043f\u0435\u0440\u0432\u044b\u0445 \u043e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u0431\u0435\u043d\u0437\u0438\u043d\u043e-\u0440\u0430\u0437\u0434\u0430\u0442\u043e\u0447\u043d\u044b\u0445 \u043a\u043e\u043b\u043e\u043d\u043e\u043a.<\/li><li>\u041e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 IX \u0412\u0441\u0435\u0441\u043e\u044e\u0437\u043d\u043e\u0433\u043e \u0441\u044a\u0435\u0437\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%BE%D1%84%D0%B5%D1%81%D1%81%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%81%D0%BE%D1%8E%D0%B7\" title=\"\u041f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0441\u043e\u044e\u0437\">\u043f\u0440\u043e\u0444\u0441\u043e\u044e\u0437\u043e\u0432<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BB%D0%BE%D0%B4%D0%B0%D1%8F_%D0%B3%D0%B2%D0%B0%D1%80%D0%B4%D0%B8%D1%8F_(%D0%B8%D0%B7%D0%B4%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE)\" title=\"\u041c\u043e\u043b\u043e\u0434\u0430\u044f \u0433\u0432\u0430\u0440\u0434\u0438\u044f (\u0438\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e)\">\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u00ab\u041c\u043e\u043b\u043e\u0434\u0430\u044f \u0433\u0432\u0430\u0440\u0434\u0438\u044f\u00bb<\/a> \u043f\u043e \u0438\u043d\u0438\u0446\u0438\u0430\u0442\u0438\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BA%D1%81%D0%B8%D0%BC_%D0%93%D0%BE%D1%80%D1%8C%D0%BA%D0%B8%D0%B9\" title=\"\u041c\u0430\u043a\u0441\u0438\u043c \u0413\u043e\u0440\u044c\u043a\u0438\u0439\">\u041c\u0430\u043a\u0441\u0438\u043c\u0430 \u0413\u043e\u0440\u044c\u043a\u043e\u0433\u043e<\/a> \u043f\u0440\u0438\u0441\u0442\u0443\u043f\u0438\u043b\u043e \u043a \u0432\u044b\u043f\u0443\u0441\u043a\u0443 \u0441\u0435\u0440\u0438\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B8%D0%B7%D0%BD%D1%8C_%D0%B7%D0%B0%D0%BC%D0%B5%D1%87%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D1%8B%D1%85_%D0%BB%D1%8E%D0%B4%D0%B5%D0%B9\" title=\"\u0416\u0438\u0437\u043d\u044c \u0437\u0430\u043c\u0435\u0447\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u043b\u044e\u0434\u0435\u0439\">\u0416\u0438\u0437\u043d\u044c \u0437\u0430\u043c\u0435\u0447\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u043b\u044e\u0434\u0435\u0439<\/a>\u00bb. \u041f\u0435\u0440\u0432\u043e\u0439 \u0431\u044b\u043b\u0430 \u043d\u0430\u043f\u0435\u0447\u0430\u0442\u0430\u043d\u0430 \u043a\u043d\u0438\u0433\u0430 \u00ab\u0413\u0435\u043d\u0440\u0438\u0445 \u0413\u0435\u0439\u043d\u0435\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%B9%D1%87,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%98%D0%BE%D1%81%D0%B8%D1%84%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0414\u0435\u0439\u0447, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0418\u043e\u0441\u0438\u0444\u043e\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u0414\u0435\u0439\u0447\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1934_%D0%B3%D0%BE%D0%B4\" title=\"1934 \u0433\u043e\u0434\">1934<\/a><ul><li>\u041f\u0435\u0440\u0432\u043e\u0435 \u043f\u0440\u0438\u0441\u0432\u043e\u0435\u043d\u0438\u0435 \u0437\u0432\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BE%D0%B9_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%A1%D0%BE%D1%8E%D0%B7%D0%B0\" title=\"\u0413\u0435\u0440\u043e\u0439 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430\">\u0413\u0435\u0440\u043e\u0439 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430<\/a> \u0441\u0435\u043c\u0435\u0440\u044b\u043c \u043b\u0451\u0442\u0447\u0438\u043a\u0430\u043c (\u041c.&#160;\u0412.&#160;\u0412\u043e\u0434\u043e\u043f\u044c\u044f\u043d\u043e\u0432, \u0418.&#160;\u0412.&#160;\u0414\u043e\u0440\u043e\u043d\u0438\u043d, \u041d.&#160;\u041f.&#160;\u041a\u0430\u043c\u0430\u043d\u0438\u043d, \u0421.&#160;\u0410.&#160;\u041b\u0435\u0432\u0430\u043d\u0435\u0432\u0441\u043a\u0438\u0439, \u0410.&#160;\u0412.&#160;\u041b\u044f\u043f\u0438\u0434\u0435\u0432\u0441\u043a\u0438\u0439, \u0412.&#160;\u0421.&#160;\u041c\u043e\u043b\u043e\u043a\u043e\u0432, \u041c.&#160;\u0422.&#160;\u0421\u043b\u0435\u043f\u043d\u0435\u0432), \u0441\u043f\u0430\u0441\u0448\u0438\u043c \u044d\u043a\u0438\u043f\u0430\u0436 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BE%D1%85%D0%BE%D0%B4\" title=\"\u041f\u0430\u0440\u043e\u0445\u043e\u0434\">\u043f\u0430\u0440\u043e\u0445\u043e\u0434\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D0%BB%D1%8E%D1%81%D0%BA%D0%B8%D0%BD_(%D0%BF%D0%B0%D1%80%D0%BE%D1%85%D0%BE%D0%B4)\" title=\"\u0427\u0435\u043b\u044e\u0441\u043a\u0438\u043d (\u043f\u0430\u0440\u043e\u0445\u043e\u0434)\">\u0427\u0435\u043b\u044e\u0441\u043a\u0438\u043d<\/a>\u00bb.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a> \u043f\u0440\u043e\u0448\u043b\u0430 \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u043a\u0438\u043d\u043e\u0444\u0438\u043b\u044c\u043c\u0430 Stand Up and Cheer, \u0432 \u043a\u043e\u