40\u0441\u0438\u0442\u0435\u0442\u0430, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%81%D1%81%D0%BE%D0%B2%D0%BE%D0%B5_%D1%83%D0%B1%D0%B8%D0%B9%D1%81%D1%82%D0%B2%D0%BE_%D0%B2_%D0%92%D0%B8%D1%80%D0%B3%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%BC_%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D1%85%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%BC_%D0%B8%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%82%D0%B5\" title=\"\u041c\u0430\u0441\u0441\u043e\u0432\u043e\u0435 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u043e \u0432 \u0412\u0438\u0440\u0433\u0438\u043d\u0441\u043a\u043e\u043c \u043f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u043c \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442\u0435\">\u0443\u0431\u0438\u0442\u044b\u043c<\/a> \u0441\u0442\u0443\u0434\u0435\u043d\u0442\u043e\u043c-\u043a\u043e\u0440\u0435\u0439\u0446\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%BE_%D0%A1%D1%8B%D0%BD_%D0%A5%D0%B8\" title=\"\u0427\u043e \u0421\u044b\u043d \u0425\u0438\">\u0427\u043e \u0421\u044b\u043d \u0425\u0438<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D1%8C%D1%8E%D1%81%D1%82%D0%BE%D0%BD\" title=\"\u0425\u044c\u044e\u0441\u0442\u043e\u043d\">\u0425\u044c\u044e\u0441\u0442\u043e\u043d\u0435<\/a> (\u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%85%D0%B0%D1%81\" title=\"\u0422\u0435\u0445\u0430\u0441\">\u0422\u0435\u0445\u0430\u0441<\/a>) \u0432 \u0437\u0434\u0430\u043d\u0438\u0438 \u2116&#160;44 \u043e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%90%D0%A